import React from 'react';
import cookie from 'js-cookie';
import { useNavigate } from 'react-router';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { Button } from '@mui/material';

export default function Home() {
  const [statusCode, setstatusCode] = useState(null);
  const [data, setdata] = useState('');
  useEffect(() => {
    const headers = {
      token: cookie.get('jwt'),
    };
    axios
      .get('http://localhost:8000/getdata', { headers: headers })
      .then((res) => {
        console.log(res.data.data);
        console.log(res.status);
        setdata(res.data.data);
        setstatusCode(res.status);
        // console.log(statusCode);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  // console.log(`this is from outside ${statusCode}`);
  const navigate = useNavigate();
  const clickHandler = () => {
    const tokenlogout = undefined;
    cookie.set('jwt', tokenlogout);
    navigate('/Login');
  };

  return (
    <div>
      {statusCode !== 200 ? (
        <h1>something went seriously wrong</h1>
      ) : (
        <div>
          <h1>{cookie.get('jwt')}</h1>
          <h1>{data.message}</h1>
          <Button onClick={clickHandler} variant="contained" className="m-5">
            Logout
          </Button>
        </div>
      )}
    </div>
  );
}
